import Vue from 'vue';
import VueRouter from 'vue-router';
import Home from '../views/Home.vue';
import Login from '../views/login';
import Redirect from '../views/redirect';
import config from '../config/index';
import serverApi from '@/pages/logistics-data/serverApi';

console.log('serverApi', serverApi);
const serverType = serverApi.url; //'logistics-data';

Vue.use(VueRouter);

// 布局框架
import Layout from '../views/layout';

/**
 * Note: sub-menu only appear when route children.length >= 1
 * Detail see: https://panjiachen.github.io/vue-element-admin-site/guide/essentials/router-and-nav.html
 *
 * hidden: true                   if set true, item will not show in the sidebar(default is false)
 * alwaysShow: true               if set true, will always show the root menu
 *                                if not set alwaysShow, when item has more than one children route,
 *                                it will becomes nested mode, otherwise not show the root menu
 * redirect: noRedirect           if set noRedirect will no redirect in the breadcrumb
 * name:'router-name'             the name is used by <keep-alive> (must set!!!)
 * meta : {
    roles: ['admin','editor']    control the page roles (you can set multiple roles)
    title: 'title'               the name show in sidebar and breadcrumb (recommend set)
    icon: 'svg-name'/'el-icon-x' the icon show in the sidebar
    noCache: true                if set true, the page will no be cached(default is false)
    affix: true                  if set true, the tag will affix in the tags-view
    breadcrumb: false            if set false, the item will hidden in breadcrumb(default is true)
    activeMenu: '/example/list'  if set path, the sidebar will highlight the path you set
  }
 */

export const routes = [
  {
    path: '/redirect',
    component: Layout,
    hidden: true,
    children: [
      {
        path: '/redirect/:path(.*)',
        component: Redirect
      }
    ]
  },
  {
    path: '/login',
    name: 'Login',
    component: Login,
    meta: {
      title: '跳转登录中'
    },
    hidden: true
  },
  {
    path: '/sso/auth',
    redirect: '/home',
    hidden: true
  },
  {
    path: '/',
    name: 'Layout',
    redirect: '/home',
    component: Layout,
    children: [
      {
        path: '/home',
        name: 'Dashboard',
        component: Home,
        meta: { title: '首页', icon: 'dashboard' }
      },
      {
        path: '/costCenter',
        name: 'costCenter',
        component: () =>
          import(/* webpackChunkName: "courseScore" */ '../views/CostCenter'),
        meta: { title: '成本中心' }
      },
      {
        path: '/humanResource',
        name: 'humanResource',
        component: () =>
          import(
            /* webpackChunkName: "courseScore" */ '../views/HumanResource'
          ),
        meta: { title: '人资导入' }
      },
      {
        path: '/finance',
        name: 'finance',
        component: () =>
          import(/* webpackChunkName: "courseScore" */ '../views/Finance'),
        meta: { title: '财务导入' }
      }
    ]
  },
  {
    path: '/error',
    name: 'Layout',
    hidden: true,
    component: Layout,
    children: [
      {
        path: '/error/NotFound',
        name: 'NotFound',
        component: () =>
          import(
            /* webpackChunkName: "sims-not-found" */ '../views/demo/NotFound.vue'
          ),
        meta: { title: '404', icon: 'dashboard' }
      }
    ]
  }
];

// 异步加载路由
export const asyncRoutes = [
  // {
  //   path: '/test',
  //   component: Layout,
  //   redirect: '/test/dynamic-form',
  //   meta: {
  //     title: 'Demo',
  //     icon: 'example'
  //   },
  //   children: [
  //     {
  //       path: '/test/dynamic-form',
  //       name: 'DynamicFormPage',
  //       meta: {
  //         title: '动态表单演示'
  //       },
  //       component: () =>
  //         import(
  //           /* webpackChunkName: "sims-dynamic-form" */ '../views/test/DynamicFormPage/index'
  //         )
  //     }
  //   ]
  // },
  {
    path: '/system',
    component: Layout,
    redirect: '/system/user',
    meta: {
      title: '系统管理',
      icon: 'component'
    },
    children: [
      {
        path: '/system/user',
        name: 'BUserManage',
        meta: {
          title: '用户管理'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-user-manage" */ '@/pages/logistics-data/views/UserManage'
          )
      },
      {
        path: '/system/userPermission',
        name: 'userPermission',
        hidden: true,
        meta: {
          title: '分配数据权限'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "userPermission" */
            '@/pages/logistics-data/views/UserManage/user-permission'
          )
      },
      {
        path: '/system/role',
        name: 'BRoleManage',
        meta: {
          title: '角色管理'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-role-manage" */ '@/components/business/BRoleManage'
          )
      },
      {
        path: '/system/role/allot-user',
        name: 'BAllotUser',
        hidden: true,
        meta: {
          title: '分配用户'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-allot-user" */ '@/components/business/BAllotUser'
          )
      },
      {
        path: '/system/role/menu-auth',
        name: 'BRoleAuthMenu',
        hidden: true,
        meta: {
          title: '菜单授权'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-role-auth-menu" */ '@/components/business/BRoleAuthMenu'
          )
      },
      {
        path: '/system/menu',
        name: 'BMenuManage',
        meta: {
          title: '菜单管理'
        },
        props: {
          serverType: serverType,
          rootTitle: config.title
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-menu-manage" */ '@/components/business/BMenuManage'
          )
      },
      {
        path: '/system/dict',
        name: 'BDataDict',
        meta: {
          title: '数据字典'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-data-dict" */ '@/pages/logistics-data/views/DataDict'
          )
      },
      {
        path: '/system/org',
        name: 'Org',
        meta: {
          title: '组织架构设置'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-data-dict" */ '@/pages/logistics-data/views/Org'
          )
      },
      {
        path: '/system/base-data',
        name: 'BaseData',
        meta: {
          title: '基础数据设置'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-data-dict" */ '@/pages/logistics-data/views/BaseData'
          )
      },
      {
        path: '/system/log',
        name: 'BLogManage',
        meta: {
          title: '系统日志'
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-log-manage" */ '@/components/business/BLogManage'
          )
      }
    ]
  },
  {
    path: '/data',
    component: Layout,
    redirect: '/data/collection/1',
    meta: {
      title: '数据采集',
      icon: 'component'
    },
    children: [
      {
        path: '/data/collection/restaurant', //餐厅类
        name: 'Restaurant',
        meta: {
          title: ''
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-data-collection" */ '@/pages/logistics-data/views/Collection/restaurant'
          )
      },
      {
        path: '/data/collection/energy', //能耗类
        name: 'Energy',
        meta: {
          title: ''
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-data-collection" */ '@/pages/logistics-data/views/Collection/energy'
          )
      },
      {
        path: '/data/collection/:type',
        name: 'DataCollection',
        meta: {
          title: ''
        },
        props: {
          serverType: serverType
        },
        component: () =>
          import(
            /* webpackChunkName: "sims-b-data-collection" */ '@/pages/logistics-data/views/Collection'
          )
      }
    ]
  },
  // NotFound路由配置必须在最后一个
  {
    path: '*',
    name: 'NotFound',
    hidden: true,
    redirect: '/error/NotFound'
  }
];

const createRouter = () =>
  new VueRouter({
    mode: 'history', // require service support
    base: process.env.VUE_APP_PUBLIC_PATH + serverType,
    scrollBehavior: () => ({ y: 0 }),
    routes: routes
  });

const router = createRouter();

// // Detail see: https://github.com/vuejs/vue-router/issues/1234#issuecomment-357941465
export function resetRouter() {
  const newRouter = createRouter();
  router.matcher = newRouter.matcher; // reset router
}

// /**
//  * 生成路由
//  * @param {*} menuList 菜单列表
//  */
export function generateRoutes(menuList) {
  if (!Array.isArray(menuList)) menuList = [];
  let menuUrlList = menuList.map(item => item.url);
  let fn = function(arr) {
    let list = arr.filter(item => {
      let res =
        menuUrlList.indexOf(item.path) !== -1 ||
        (item.path || '').match(/\/:type$/); //不过滤数据采集
      res &&
        Array.isArray(item.children) &&
        item.children.length &&
        (item.children = fn(item.children));
      return res;
    });
    return list;
  };
  console.log('asyncRoutes', asyncRoutes);
  let tree = fn(asyncRoutes);
  // 添加404路由配置，因为*匹配需要放最后面。
  tree.push(asyncRoutes[asyncRoutes.length - 1]);
  console.log('tree', tree);
  return tree;
}

export default router;
